package _002_String_Class;



public class _011_compareTo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		

		System.out.println("a".compareTo("b"));// a is comes earlier than b  - lexicographically -
		System.out.println("b".compareTo("a"));// b is comes later than a    - lexicographically -
		System.out.println("x".compareTo("x"));// two letters are same order - lexicographically -
		System.out.println("a".compareTo("c"));// a is comes earlier than c  - lexicographically -
		System.out.println("a".compareTo("z"));// there 25 letters beetwen a to z
		
		
		}
		}